function detailUserProfileDialog(el) {
    var data = $(el).data('detail');
    $('.clear').val('');
    $('#md-UserProfile-detail').modal('show');

				$('#Detail-UserProfile-Address').val(data.address);
				$('#Detail-UserProfile-BirthDate').val(data.birthDate);
				$('#Detail-UserProfile-BirthPlace').val(data.birthPlace);
				$('#Detail-UserProfile-Gender').val(data.gender);
				$('#Detail-UserProfile-IdDati').val(data.idDati);
				$('#Detail-UserProfile-Nationality').val(data.nationality);
				$('#Detail-UserProfile-Nik').val(data.nik);
				$('#Detail-UserProfile-Nip').val(data.nip);
				$('#Detail-UserProfile-Profession').val(data.profession);

}
